import React from 'react';
import "./App.css";


function LeftArea () {
  return (
    <div className = "left-area">
      <div className = "desin_system">
        Design
        System
        for ITRM
      </div>
      <div className = "style_guide">
        STYLE GUIDE
      </div>
      <div className = "style_guide_elements">
        Color
        Typography
        Icon
        Logo
      </div>
      <div className = "ui_conponent">
        UI Component
      </div>
      <div className = "ui_conponent_elements">

      </div>
    </div>
  );
}

function Contents(){
  return <div className = "content-area">이거슨 메인</div>;
}

function App() {
  return(
      <div>
        <LeftArea />
        <Contents />
      </div>
    );
}

export default App;
